package com.bridgelabz;
public class Fourthpattern {
    public static void main(String[] args) {

        // TODO Auto-generated method stub
        int i;
        for (i = 1; i < 6; i++) {
            int j;
            for (j = 1; j <= 5; j++) {
                System.out.print("*");
            }
            System.out.println("");
        }

    }
}
